define(["utils","gitee"],(function(i,t){return{data:()=>({searchTxt:"",links:[],cache:!0,headerLinks:[]}),methods:{open(i){this.searchTxt="",this.links=originLinks,window.open(i.url)},filter(){this.searchTxt||(this.links=originLinks);let i=this.searchTxt.toUpperCase();this.links=originLinks.filter((t=>-1!==t.title.toUpperCase().indexOf(i)||-1!==t.note.toUpperCase().indexOf(i)))},loadData(){t.getFileContent("data/pages.link.json",!1,!0).then((i=>{let t=i.map((i=>({title:i[0],url:i[1],note:i[2]})));originLinks=t,this.links=originLinks}))},refreshCache(){confirm("确认重新加载数据?")&&(this.cache=!1,this.loadData(),this.cache=!0)}},mounted(){this.loadData()},template:'\n        <div class="container mt-4">\n            <div class="row justify-content-center">\n                <div class="col-md-4 col-lg-3 p-2" v-for="link in links">\n                    <div class="alert alert-dismissible alert-light overflow-hidden" @click="open(link)" style="cursor:pointer">\n                        <h4 class="text-nowrap" :title="link.title">{{link.title}}</h4>\n                        <p class="d-inline text-nowrap" :title="link.note">{{link.note}}</p>\n                    </div>\n                </div>\n            </div>\n        </div>\n        '}}));